var express = require('express');
var app = express();
var bodyParser = require('body-parser');

app.use(bodyParser.urlencoded({ extended: true }));

app.set('view engine', 'ejs');

var campgrounds = [
    { name: "vishal", image: "data:image/jpeg;base64," },
    { name: "sanjeev", image: "data:image/jpeg;base64," },
    { name: "kunal", image: "data:image/jpeg;base64," }, { name: "vishal", image: "data:image/jpeg;base64," },
    { name: "sanjeev", image: "data:image/jpeg;base64," },
    { name: "kunal", image: "data:image/jpeg;base64," }
];

app.get("/", (req, res) => {
    res.render('landing')
});

app.get('/campgrounds', (req, res) => {
    res.render('campgrounds', { campgrounds: campgrounds });
});

app.post('/campgrounds', (req, res) => {
    //get data from form
    var name = req.body.name;
    var image = req.body.image;
    var newCampground = { name: name, image: image }
    campgrounds.push(newCampground);

    //redirct back to campgroud page 
    res.redirect('/campgrounds')
});

app.get('/campgrounds/new', (req, res) => {
    res.render('new.ejs');
});

app.listen(7000, () => {
    console.log("server started at : 7000");
});